import React, { Component } from 'react'
import villiansData from '../src/data/joker'

const name = villiansData.joker[0].name



class Villians extends Component {
    render() {
        return (
            <div>
                <h1>{name.length}Villians</h1>
            </div>

        )

    }



}

export default Villians
